import React,{useState,useEffect} from "react";
import axios from 'axios';
import {GET,POST} from '../api/apiAdapter';
import PageLayout from "./PageLayout";

const URL="/alchemy"
const title = useRef(null)
function ImperialAlchemy() {
   const [data,setData] = useState(null)
   const title = useRef(null)
   useEffect(() => {
      GET(URL).then((response) => {
         setData(response.data)
      })
      },[] )

   return (
      <PageLayout          
      title={
         <>
            <p id='title' ref={title}>Imperial Alchemy</p>
            <p class='description'>Determine imperial delivery profit from various elixirs based on marketplace value or total revenue</p>
         </>
      }

      input={
         <p>Input</p>
      }

      table={
         <p>Table</p>
      }
      />     
   )
}


export default ImperialAlchemy
